import { Button, Table } from 'antd';
import axios from 'axios';
import { useEffect, useState } from 'react';
import url from '../components/host';
import { AiOutlineCheck,AiOutlineClose } from "react-icons/ai";
import "./style/style.css"
import { render } from '@testing-library/react';




const Tables = () => {
  const [selectedRowKeys, setSelectedRowKeys] = useState([]);
  const [loading, setLoading] = useState(false);
  const [data, setdata] = useState([])
  const [page,setPage] = useState(1)
  const [item,setItem] = useState([])
 const  columns = [
  {
    title: 'Id',
    dataIndex: 'id',
  },
  {
    title: 'Name',
    dataIndex: 'name',
  },
  {
    title: 'Price',
    dataIndex: 'price',
  },
  {
    title: 'Status',
    dataIndex: 'is_active',
    render: (el )=><div  >{el?(<h1 style={{color:"green"}}><AiOutlineCheck/></h1>):(<h1 style={{color:"red"}} ><AiOutlineClose/></h1>)}</div>


  },
  {
    title: "Ma'lumot",
    key: "edit",
    width: "5%",
    render: (__,item) => {
        return <div><Button onClick={()=>{getOneProduct(item)}} style={{ background: 'orange', color: 'white' }} type="text">Ma'lumot</Button></div>
    }
},
{
  title: "Edit",
  key: "edit",
  width: "5%",
  render: () => {
      return <div><Button style={{ background: 'orange', color: 'white' }}  type="danger">O'zgartirish</Button></div>
  }
},
{
  title: "Delete",
  key: "delete",
  width: "5%",
  render: () => {
      return <div><Button type="danger">O'chirish</Button></div>
  }
},
];

const getOneProduct=(item)=>{
  console.log(item);
  setPage(2)
  setItem(item)
}

  function getData() {
    axios.get(`${url}/api/cars/`).then(res => {
      setdata( res.data )
    })
  }
  useEffect(() => {
    getData()
  }, [])

  const start = () => {
    setLoading(true);
    // ajax request after empty completing
    setTimeout(() => {
      setSelectedRowKeys([]);
      setLoading(false);
    }, 100);
  };




  return (
    <div>
{page==2?( <Table className='table'  columns={columns} dataSource={data} />  ):(<div className="div">
{item.map(otash=>{
return <div>
  <div>{otash.id}</div>
</div>
})}

</div>)}


    </div>
  );
};
export default Tables;
